import React,{useState} from 'react';

const Main = ()=>{
    const [file, setFile] = useState(null);

    const handleFileUpload = (event) => {
        setFile(event.target.files[0]);
    };
    return (
        <>
        <h1>Stutora</h1>
        <form>
            <label>
                    Choose an image to upload:
                    <input type="file" name="image" onChange={handleFileUpload} />
                </label>
        </form>
        </>
    )

}
export default Main;
